function splitBigASCII(asciiPic, lengthy = 103) {
    // 122 + 1 if friend list is hidded (1920 x 1080 resolution)
    // discord max line length = 102 symbols + 1 for escape (\n)
    const MaxLineLength = lengthy;
    //discord max message is 2000 symbols
    const MaxMessage = 2000;
    var asciiSet = [];
    var allowedLinesInOneSet = Math.floor(MaxMessage / MaxLineLength);

    for (
        var currentSet = 0;
        currentSet < Math.ceil(asciiPic.length / (allowedLinesInOneSet * MaxLineLength));
        currentSet++
    ) {
        var part = "";
        for (
            var i = 0;
            i < allowedLinesInOneSet * MaxLineLength &&
            asciiPic[i + currentSet * allowedLinesInOneSet * MaxLineLength];
            i++
        ) {
            part += asciiPic[i + currentSet * allowedLinesInOneSet * MaxLineLength];
        }
        asciiSet.push(part);
    }

    return asciiSet;
}

